import Flex from "./Flex";
import Input from "./Input";

function Practice2() {
  return (
    <Flex>
        <h1>로그인</h1>
        <label for="mail">Email</label>
        <Input id="mail" type="e-mail" placeholder="google.com"/>
        <label>PassWord</label>
        <Input  type="password" placeholder="비밀번호"/>
    </Flex>

  );
}

export default Practice2;
